import React, { useEffect, useState } from "react";

const AutoPolicyDashboard = () => {
  const [autos, setAutos] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/api/auto/950416")
      .then((res) => res.json())
      .then((data) => setAutos([...autos, ...data]));
  }, []);
  return (
    <div className="row">
      <div className="col-5">
        <ul className="list-group"></ul>
      </div>
      <div className="col-5 align-self-end">jaja</div>
    </div>
  );
};

export default AutoPolicyDashboard;
